import React from 'react';
import { ScatterChart, Scatter, XAxis, YAxis, ZAxis, Tooltip, ResponsiveContainer, ReferenceLine, Cell } from 'recharts';
import { Trophy, Zap, AlertCircle } from 'lucide-react';

const Dashboard = ({ data, onUserSelect }) => {
  // Sorting data by Impact Z-score for the Leaderboard
  const leaderboard = [...data].sort((a, b) => b.imp_z - a.imp_z);

  const getColor = (node) => {
    if (node.imp_z > 0 && node.vis_z < 0) return '#10b981'; // Silent Architect (Green)
    if (node.imp_z > 0 && node.vis_z > 0) return '#3b82f6'; // Force Multiplier (Blue)
    return '#64748b'; // Others (Slate)
  };

  return (
    <div className="flex gap-6 h-full">
      {/* 1. The Interactive Quadrant */}
      <div className="flex-[3] bg-slate-900/50 backdrop-blur-md p-6 rounded-3xl border border-white/10 shadow-2xl">
        <h2 className="text-xl font-bold text-white mb-6 flex items-center gap-2">
          <Zap className="text-yellow-400" size={20} /> Impact-Visibility Matrix
        </h2>
        <div className="h-[500px] w-full">
          <ResponsiveContainer>
            <ScatterChart margin={{ top: 20, right: 30, bottom: 20, left: 10 }}>
              <XAxis type="number" dataKey="vis_z" name="Visibility" stroke="#475569" tick={{fill: '#94a3b8'}} label={{ value: 'Noise (Visibility)', position: 'bottom', fill: '#94a3b8', fontSize: 12 }} />
              <YAxis type="number" dataKey="imp_z" name="Impact" stroke="#475569" tick={{fill: '#94a3b8'}} label={{ value: 'Signal (Impact)', angle: -90, position: 'left', fill: '#94a3b8', fontSize: 12 }} />
              <Tooltip cursor={{ strokeDasharray: '3 3' }} contentStyle={{ backgroundColor: '#1e293b', border: 'none', borderRadius: '12px', color: '#f8fafc' }} />
              <ReferenceLine x={0} stroke="#334155" />
              <ReferenceLine y={0} stroke="#334155" />
              <Scatter data={data} onClick={(e) => onUserSelect(e.payload)}>
                {data.map((entry, index) => (
                  <Cell key={`cell-${index}`} fill={getColor(entry)} className="hover:scale-125 transition-transform duration-300 cursor-pointer" />
                ))}
              </Scatter>
            </ScatterChart>
          </ResponsiveContainer>
        </div>
      </div>

      {/* 2. Global Ranking (Leaderboard) */}
      <div className="flex-1 bg-slate-900/50 backdrop-blur-md p-6 rounded-3xl border border-white/10 overflow-y-auto">
        <h2 className="text-xl font-bold text-white mb-6 flex items-center gap-2">
          <Trophy className="text-orange-400" size={20} /> Talent Ranking
        </h2>
        <div className="space-y-4">
          {leaderboard.map((user, index) => (
            <div 
              key={user.name} 
              onClick={() => onUserSelect(user)}
              className="group flex items-center justify-between p-3 rounded-xl bg-slate-800/40 hover:bg-blue-600/20 border border-transparent hover:border-blue-500/50 transition-all cursor-pointer"
            >
              <div className="flex items-center gap-3">
                <span className={`text-lg font-black ${index < 3 ? 'text-yellow-400' : 'text-slate-500'}`}>#{index + 1}</span>
                <div>
                  <div className="text-white font-semibold text-sm">{user.name}</div>
                  <div className="text-[10px] text-slate-400 uppercase tracking-tighter">Impact Z: {user.imp_z.toFixed(2)}</div>
                </div>
              </div>
              {user.imp_z > 1 && <AlertCircle size={14} className="text-emerald-400 animate-pulse" />}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
